export const CURSOR_ADD = "CURSOR_ADD";
export const MAKE_INVISIBLE = "MAKE_INVISIBLE";

export function cursorAdd(s) {
  return {
    type: CURSOR_ADD,
    sound: s
  };
}

export function makeInvisible() {
  return {
    type: MAKE_INVISIBLE
  };
}
